"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Thyroid nodules (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/thyroid-nodules-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H30633497\">",
"      <span class=\"h1\">",
"       What are thyroid nodules?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Thyroid nodules are round or oval-shaped growths in the thyroid gland. The thyroid gland is in the middle of the neck (",
"      <a class=\"graphic graphic_figure graphicRef66834 \" href=\"UTD.htm?14/43/15024\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Thyroid nodules are common and are not usually harmful to a person&rsquo;s health. But sometimes, thyroid nodules are caused by a serious condition, such as cancer.",
"     </p>",
"     <p>",
"      The thyroid gland makes a hormone called &ldquo;thyroid hormone.&rdquo; Most thyroid nodules do not change the amount of thyroid hormone in the body. But some cause the thyroid gland to make too much thyroid hormone. This can cause symptoms.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H30633504\">",
"      <span class=\"h1\">",
"       What are the symptoms of a thyroid nodule?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Some people do not have any symptoms. They might find out that they have a thyroid nodule when their doctor or nurse feels it during a routine exam. Or a doctor might find nodules on an imaging test that was done for another condition. (Imaging tests create pictures of the inside of the body.)",
"     </p>",
"     <p>",
"      Other people have symptoms. For example, they might feel or see a lump in their neck. Or they have symptoms from having too much thyroid hormone, such as:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Feeling worried, upset, or having trouble sleeping",
"       </li>",
"       <li>",
"        Feeling weak or tired",
"       </li>",
"       <li>",
"        Losing weight without trying",
"       </li>",
"       <li>",
"        Having a fast heartbeat",
"       </li>",
"       <li>",
"        Having frequent bowel movements",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H30633511\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor will want to make sure that the thyroid nodule is not a threat to your health. Tests usually include blood tests and an imaging test of the thyroid called an ultrasound. Sometimes, people need more tests. These include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Fine needle aspiration &mdash; For this test, a doctor uses a thin needle to remove a small sample of tissue from the thyroid nodule. Then another doctor looks at the tissue under a microscope.",
"       </li>",
"       <li>",
"        Thyroid scan &mdash; People get this test only if they have too much thyroid hormone in the body. For this test, a person gets a pill or a shot with a small amount of a radioactive substance. Then, a special camera takes a picture of the thyroid gland. This test is not safe for women who are pregnant or breastfeeding.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H30633518\">",
"      <span class=\"h1\">",
"       How are thyroid nodules treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Thyroid nodules are treated in different ways, depending on their cause and how much thyroid hormone is in the body. Different treatments include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Watching and waiting &mdash; Doctors don&rsquo;t always treat thyroid nodules right away. A doctor might watch a thyroid nodule if it is small and doesn&rsquo;t look serious. But he or she will follow it closely to see if it grows bigger or needs to be treated.",
"       </li>",
"       <li>",
"        Medicines &mdash; Doctors can shrink thyroid nodules using thyroid hormone medicines. If you take thyroid hormone medicines, your doctor or nurse will check your thyroid hormone levels on a regular basis.",
"       </li>",
"       <li>",
"        Radioactive iodine &mdash; Radioactive iodine comes in a pill or liquid that you swallow. It has a small amount of radiation and can destroy a lot of the thyroid gland. It is used only to treat nodules that make too much thyroid hormone. It is not safe for women who are pregnant or breastfeeding.",
"       </li>",
"       <li>",
"        Surgery to remove the thyroid nodule",
"       </li>",
"       <li>",
"        A procedure to drain fluid from the thyroid nodule, if it is filled with fluid",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H30633525\">",
"      <span class=\"h1\">",
"       What if I want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you want to get pregnant, talk with your doctor or nurse. Women who are pregnant should not be treated with radioactive iodine. That&rsquo;s because radioactive iodine can cause serious harm to a baby. If a woman is treated with radioactive iodine, she needs to wait at least 6 months before trying to get pregnant. That way, her doctor can make sure that her nodule is no longer making too much thyroid hormone.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H30633532\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
