"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Vaccines for adults (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/vaccines-for-adults-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H29995795\">",
"      <span class=\"h1\">",
"       What are vaccines?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Vaccines are treatments that can prevent certain serious or deadly infections. They work by teaching the body how to fight the germs that cause the infections. Vaccines usually come in shots, but some come in nose sprays or medicines that people swallow. Vaccines are also called &ldquo;vaccinations&rdquo; or &ldquo;immunizations.&rdquo;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29995802\">",
"      <span class=\"h1\">",
"       Why should I get vaccinated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Getting vaccinated can help keep you from getting sick with certain infections. Plus, being vaccinated helps to protect the people around you from getting sick.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29995809\">",
"      <span class=\"h1\">",
"       Which vaccines should adults get?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor or nurse will tell you which vaccines you should get.",
"     </p>",
"     <p>",
"      There are some vaccines that all adults should get, even if they got their childhood vaccines. These vaccines protect against the following infections:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Influenza (flu) &ndash; The flu can cause fever, chills, muscle aches, cough, or sore throat.",
"       </li>",
"       <li>",
"        Diphtheria and tetanus &ndash; Vaccines against these 2 diseases are usually together in one shot. Diphtheria can cause a thick covering in the back of the throat that can lead to breathing problems. Tetanus causes the muscles to work abnormally.",
"       </li>",
"       <li>",
"        Pertussis &ndash; This infection is also known as &ldquo;whooping cough&rdquo; and can cause a severe breathing illness in babies. Adults need to be vaccinated against pertussis 1 time. This helps prevent young children around them from getting the infection. The pertussis vaccine can come in the same shot as the diphtheria and tetanus vaccines.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Some adults will need other vaccines, depending on their age, medical conditions, jobs, travel plans, and other factors. These can include vaccines to protect against:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Pneumococcus &ndash; Pneumococcus is a germ that can cause an infection of the lungs, ears, blood, or tissues around the brain.",
"       </li>",
"       <li>",
"        Meningococcus &ndash; Meningococcus is a germ that can cause an infection of the blood or tissues around the brain.",
"       </li>",
"       <li>",
"        Herpes zoster, also called &ldquo;shingles&rdquo; &ndash; Shingles can cause a painful skin rash and blisters.",
"       </li>",
"       <li>",
"        Human papillomavirus (HPV) &ndash; HPV infection can lead to cancer of the cervix (in women). It can also cause genital warts in men and women. Young adult women should get this vaccine. Young adult men can choose to have the vaccine or not.",
"       </li>",
"       <li>",
"        Other infections such as measles, chickenpox, hepatitis B, and hepatitis A",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Adults might need these other vaccines if they:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Were born after 1956",
"       </li>",
"       <li>",
"        Never got all of their childhood vaccines",
"       </li>",
"       <li>",
"        Have certain medical conditions",
"       </li>",
"       <li>",
"        Work in healthcare or public safety",
"       </li>",
"       <li>",
"        Live in a nursing home or dormitory, or another place with lots of people",
"       </li>",
"       <li>",
"        Travel to certain countries",
"       </li>",
"       <li>",
"        Inject illegal drugs or have sex with a lot of partners",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29995816\">",
"      <span class=\"h1\">",
"       How many vaccine doses do I need?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Each vaccine is different. Some vaccines work after just 1 dose. Others need 2 or more doses to prevent an infection.",
"     </p>",
"     <p>",
"      Some vaccines prevent an infection for the rest of your life. Others do not. A &ldquo;booster&rdquo; is a vaccine dose given after a certain number of years. It reminds the body how to prevent an infection. People who got childhood vaccines might need booster doses as an adult. People who travel to other countries might also need booster doses of certain vaccines.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29995823\">",
"      <span class=\"h1\">",
"       When should I be vaccinated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Different vaccines are given at different ages.",
"     </p>",
"     <p>",
"      Your doctor or nurse will recommend a vaccine schedule that is right for you. Most vaccines take a few weeks to work.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29995830\">",
"      <span class=\"h1\">",
"       What side effects can vaccines cause?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Often, vaccines cause no side effects. When they do cause side effects, they can cause:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Redness, mild swelling, or soreness where the shot was given",
"       </li>",
"       <li>",
"        A mild fever",
"       </li>",
"       <li>",
"        A mild rash",
"       </li>",
"       <li>",
"        Headache or body aches",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Vaccines also sometimes cause more serious side effects, such as severe allergic reactions. But serious side effects are rare.",
"     </p>",
"     <p>",
"      Ask your doctor or nurse what side effects to expect each time you get a vaccine. If you have a reaction or a problem after a vaccine, let him or her know.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29995837\">",
"      <span class=\"h1\">",
"       What if I have an egg allergy?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you have an egg allergy, let your doctor or nurse know. Some vaccines have egg in them. Your doctor or nurse will tell you which vaccines are safe to get.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29995844\">",
"      <span class=\"h1\">",
"       What if I am pregnant or want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you are pregnant or want to get pregnant, let your doctor or nurse know. Certain vaccines should not be given to women who are pregnant or who will be pregnant soon.",
"     </p>",
