var title_f23_4_23629="DKA rapid overview child";
var content_f23_4_23629=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F76460&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F76460&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Rapid overview of the initial evaluation and treatment of moderate to severe diabetic ketoacidosis (DKA) in children and adolescents",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Definition of diabetic ketoacidosis (DKA): hyperglycemia (blood glucose of &ge;200 mg/dL (11 mmol/L) and metabolic acidosis (venous pH &lt;7.30 and/or serum bicarbonate &lt;15 meq/L), resulting in hyperosmolality and volume depletion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Evaluation: assessment of severity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Degree of dehydration - Patients with DKA are usually more dehydrated than suggested by the clinical examination. For moderate to severe DKA, initial fluid management is based on assuming 7 to 10 percent fluid deficit at presentation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Initial laboratory testing should include, at a minimum: serum testing for glucose, electrolytes, creatinine and urea nitrogen, blood gases, hematocrit, hemoglobin A1C, venous pH, and&nbsp;routine urinalysis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Neurologic status: Patients with abnormal mental status may have cerebral edema (see complications below).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Management",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        Fluids:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Initial bolus of 10 to 20 mL/kg of an isotonic solution should be given over one hour.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        A second bolus may be infused over the next hour for patients with compromised circulation. Hypovolemic shock is a rare occurrence in DKA. The patient in shock should be evaluated for other causes of shock.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Following initial fluid resuscitation, replace deficit over the next 48 hours. This fluid should be given no more rapidly than 1.5 to 2 times the maintenance rate during the first 24 hours. Use an isotonic solution for the first 4 to 6 hours, then switch to half normal saline solution.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Urinary losses should not be replaced.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        Electrolytes:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Sodium: Serum sodium levels are generally low and should rise as fluid deficit, hyperglycemia, and acidosis are corrected. Failure of the serum sodium to rise appropriately may be an early sign that the patient is at risk for cerebral edema.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Potassium: Regardless of the initial measured level of serum potassium, patients with DKA have a total body potassium deficit. Therapy with fluids and insulin will lower potassium. Therefore, potassium should be immediately added to intravenous fluid for patients who are hypokalemic. If the patient is normokalemic, potassium replacement should begin with the start of insulin therapy (eg, adding 40 meq/L of potassium to the IV solution). For patients who are hyperkalemic, potassium replacement should be initiated when the serum potassium falls to normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Insulin: After the initial fluid bolus, begin a continuous insulin infusion at 0.05 to 0.1 units/kg per hour. Mix 50 units of regular insulin in 50 mL normal saline (such that 1 mL of the infusion provides 1 unit of insulin). Do not give an initial bolus of insulin.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Glucose: Blood glucose falls rapidly during the initial volume expansion, but after that should not fall faster than 90 mg/dL (5 mmol/L) per hour. Add 5 percent dextrose solution when blood glucose falls to 300 mg/dL (17 mmol/L). Add dextrose sooner if level is dropping too quickly. It may be necessary to use a higher concentration (10 to 12.5 percent dextrose) to prevent hypoglycemia while continuing to infuse insulin to correct metabolic acidosis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Monitoring",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Record hourly vital signs and neurologic status, as well as fluid intake (intravenous and oral) and losses.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Measure blood glucose, electrolytes, and venous pH hourly for the first three to four hours. Continue to monitor blood glucose hourly. Electrolytes and venous pH may subsequently be measured every two hours.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Complications",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cerebral edema: The risk for cerebral edema is increased with young age, and with greater degree of acidosis or dehydration at presentation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Monitor neurologic status carefully. Initiate treatment with 0.25-1g/kg of mannitol as soon as cerebral edema is suspected. Reduce rate of fluid and support oxygenation and ventilation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Venous thrombosis: Avoid placing a central line.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Aspiration (as the result of altered mental status and vomiting): Consider placing nasogastric tube in children with these symptoms.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cardiac arrhythmia (as the result of hypo or hyperkalemia)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pancreatic enzyme elevations are common in DKA and do not generally reflect pancreatitis. The laboratory abnormality generally corrects with treatment of the DKA.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f23_4_23629=[""].join("\n");
var outline_f23_4_23629=null;
var title_f23_4_23630="Diagnostic criteria migraine";
var content_f23_4_23630=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F50876%7ENEURO%2F79672%7ENEURO%2F80843&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F50876%7ENEURO%2F79672%7ENEURO%2F80843&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    International Headache Society diagnostic criteria for migraine",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Migraine without aura",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A. At least five attacks fulfilling criteria B through D",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        B. Headache attacks lasting 4 to 72 hours (untreated or unsuccessfully treated)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        C. Headache has at least two of the following characteristics:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Unilateral location",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Pulsating quality",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Moderate or severe pain intensity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Aggravation by or causing avoidance of routine physical activity (eg, walking or climbing stairs)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        D. During headache at least one of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Nausea, vomiting, or both",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Photophobia and phonophobia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        E. Not attributed to another disorder",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Migraine with aura",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A. At least two attacks fulfilling criterion B",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        B. Migraine aura fulfilling criteria B and C for one of the following subforms:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Typical aura with migraine headache",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Typical aura with nonmigraine headache",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Typical aura without headache",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Familial hemiplegic migraine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Sporadic hemiplegic migraine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Basilar-type migraine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        C. Not attributed to another disorder",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Migraine with typical aura",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A. At least two attacks fulfilling criteria B through D",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        B. Aura consisting of at least one of the following, but no motor weakness:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Fully reversible visual symptoms including positive (eg, flickering lights, spots, or lines) and/or negative features (ie, loss of vision)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Fully reversible sensory symptoms including positive (ie, pins and needles) and/or negative features (ie, numbness)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Fully reversible dysphasic speech disturbance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        C. At least two of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Homonymous visual and/or unilateral sensory symptoms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        At least one aura symptom develops gradually over &ge;5 minutes and/or different aura symptoms occur in succession over &ge;5 minutes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Each symptom lasts &ge;5 and &le;60 minutes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        D. Headache fulfilling criteria B through D for migraine without aura begins during the aura or follows aura within 60 minutes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        E. Not attributed to another disorder",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Features of migraine in children",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Attacks may last 1 to 72 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Headache is commonly bilateral; an adult pattern of unilateral pain usually emerges in late adolescence or early adulthood",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Occipital headache is rare and raises diagnostic caution for structural lesions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Photophobia and phonophobia may be inferred by behavior in young children",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Headache Classification Committee of the International Headache Society. The International Classification of Headache Disorders. Cephalalgia 2004; 24:1.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Tension-type headache diagnostic criteria",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        A. At least 10 episodes fulfilling criteria B through E. The number of days per month with such headache determines the subtype:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &lt;1 day a month: infrequent episodic TTH",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 to 14 days a month: frequent episodic TTH",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &ge;15 days a month: chronic TTH",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        B. Headache lasting from 30 minutes to 7 days for episodic TTH; headache lasts hours or may be continuous for chronic TTH",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        C. At least two of the following pain characteristics:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pressing/tightening (nonpulsating) quality",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Mild or moderate intensity (may inhibit but does not prohibit activities)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Bilateral location",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        No aggravation by walking stairs or similar routine physical activity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        D. Both of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        No nausea or vomiting (anorexia may occur)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Photophobia and phonophobia are absent, or one but not the other may be present",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        E. Not attributed to another disorder",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     TTH: tension-type headache.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Headache classification subcommittee of the International Headache Society. The International Classification of Headache Disorders: 2nd edition. Cephalalgia 2004; 24(Suppl 1):9.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    ICHD-2 diagnostic criteria for cluster headache",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        A. At least five headache attacks fulfilling criteria B through D:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        B. Severe or very severe unilateral orbital, supraorbital, and/or temporal headache attacks, which last untreated for 15 to 180 minutes. During part (but less than half) of the time course of the cluster headache, attacks may be less severe, less frequent, or of shorter or longer duration.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        C. The headache is accompanied by at least one of the following symptoms:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        1. Ipsilateral conjunctival injection or lacrimation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        2. Ipsilateral nasal congestion and/or rhinorrhea",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        3. Ipsilateral eyelid edema",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        4. Ipsilateral forehead and facial sweating",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        5. Ipsilateral miosis and/or ptosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        6. A sense of restlessness and agitation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        D. The attacks have a frequency from one every other day to eight per day.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        E. History and physical and neurologic examinations do not suggest any other disorder, and/or such a disorder is ruled out by appropriate investigations, or such disorder is present but attacks do not occur for the first time in close temporal relation to the disorder.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Episodic cluster headache:",
"        </strong>",
"        At least two cluster periods lasting seven days to one year separated by pain-free periods lasting one month or longer.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Chronic cluster headache:",
"        </strong>",
"        Attacks occur for more than one year without remission or with remission less than one month.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Probable cluster headache:",
"        </strong>",
"        Attacks fulfilling all but one criteria for cluster headache.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Headache Classification Subcommittee of the International Headache Society. The International Classification of Headache Disorders: 2nd edition. Cephalalgia 2004; 24 Suppl 1:9.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
